import React from "react";
import "./Trailer.css";

// import $ from "jquery";
// import Icofont from 'react-icofont';
import OwlCarousel from 'react-owl-carousel2';
import 'react-owl-carousel2/src/owl.carousel.css';

class TrailerPage extends React.Component {
  componentDidMount() {
    console.log(document.getElementById("slider"));
  }
  render() {
    const opSLideshow = {
      items: 1,
      nav: true,
      dots: false,
      navText: ['<i class="icofont-long-arrow-left"></i>', '<i class="icofont-long-arrow-right"></i>'],
      rewind: true,
      autoplay: true,
      loop: true,
    };
    return (
      <div id="TrailerPage">
        {/* <!-- breadcroumb-area --> */}
        <div class="zmovo-breadcroumb-area">
          <div class="zmovo-breadcroumb-bg">
            <div class="container">
              <div class="zmovo-breadcroumb-inner text-center">
                <h2>Movie Trailer</h2>
                <span>Movie Trailer</span>
              </div>
            </div>
          </div>
        </div>
        {/* <!-- End breadcroumb-area --> */}
      </div>
    );
  }
}

export default TrailerPage;
